import"./hoisted.uc0jJ9DK.js";import"./hoisted.DfrgUcPP.js";document.addEventListener("DOMContentLoaded",()=>{document.querySelectorAll('.premium-btn[data-ripple="true"]').forEach(c=>{c.addEventListener("click",function(o){const r=this.querySelector(".ripple-container");if(!r)return;const e=this.getBoundingClientRect(),n=Math.max(e.width,e.height),l=o.clientX-e.left-n/2,s=o.clientY-e.top-n/2,t=document.createElement("span");t.classList.add("ripple"),t.style.width=t.style.height=n+"px",t.style.left=l+"px",t.style.top=s+"px",r.appendChild(t),setTimeout(()=>{t.remove()},600)})})});"vibrate"in navigator&&document.querySelectorAll(".premium-btn").forEach(i=>{i.addEventListener("touchstart",()=>{navigator.vibrate(10)})});
